/*********************************************************************
*
*       _cbDialog
*/
static void _cbDialog(WM_MESSAGE * pMsg) {
  const void * pData;
  WM_HWIN      hItem;
  U32          FileSize;
  // USER START (Optionally insert additional variables)
  WM_MESSAGE    _tMsg;
  // USER END

  switch (pMsg->MsgId) {
  case WM_INIT_DIALOG:
    //
    // Initialization of 'app_win_ped'
    //
    hItem = pMsg->hWin;
    WINDOW_SetBkColor(hItem, GUI_MAKE_COLOR(0x00000000));
    //
    // Initialization of 'Text_Ped'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_0);
    TEXT_SetText(hItem, "PED");
    TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
    TEXT_SetFont(hItem, GUI_FONT_32B_ASCII);
    TEXT_SetTextColor(hItem, GUI_MAKE_COLOR(0x0040FF00));
    //
    // Initialization of 'Image_Ped'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_IMAGE_0);
    pData = _GetImageById(ID_IMAGE_0_IMAGE_0, &FileSize);
    IMAGE_SetBMP(hItem, pData, FileSize);
    //
    // Initialization of 'Text_PedCnt'
    //
    hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_1);
    TEXT_SetText(hItem, "--");
    TEXT_SetTextAlign(hItem, GUI_TA_LEFT | GUI_TA_VCENTER);
    TEXT_SetFont(hItem, GUI_FONT_32B_ASCII);
    TEXT_SetTextColor(hItem, GUI_MAKE_COLOR(0x0040FF00));
    // USER START (Optionally insert additional code for further widget initialization)
    // USER END
    break;
  // USER START (Optionally insert additional message handling)
  case WM_TIMER:
    WM_RestartTimer(pMsg->Data.v, 100);
    if(TimeD<=APP_WIM_TIMER_TIMEOUT) TimeD++;
    if(TimeD!=APP_WIM_TIMER_TIMEOUT) break;

    _tMsg.MsgId  = WM_MSG_ID_CC_TIMER_TIMEOUT;
    WM_SendToParent(pMsg->hWin, &_tMsg);
    TimeD = 0;
    break;
  case WM_TOUCH:
    _tMsg.MsgId  = WM_MSG_ID_CC_WINDOW_NEXT;
    WM_SendToParent(pMsg->hWin, &_tMsg);
    break;
  case WM_MSG_ID_CC_PED_REPORT:
  {
        uint32_t _dwPedoCnt;
        _dwPedoCnt = (uint32_t) pMsg->Data.d;
        char buff [10] = {'\0'};
        sprintf (buff, "%d", _dwPedoCnt);
        hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_1);

        if (_dwPedoCnt >100000)
            TEXT_SetFont(hItem, GUI_FONT_24B_ASCII);
        else if (_dwPedoCnt >100)
            TEXT_SetFont(hItem, GUI_FONT_32B_ASCII);
        TEXT_SetText(hItem, buff);
        WM_InvalidateWindow(hItem);
  }
  break;
  // USER END
  default:
    WM_DefaultProc(pMsg);
    break;
  }
}

